  console.log({user})
  if (!user) {
    console.log(children)
    return children
  }
  if (user) {
    console.log(children)
    return <Navigate to={ROUTES.SIGN_IN} />
  }
  return null
}
RequiredAuth.propTypes = {
  user: PropTypes.object,
  children: PropTypes.object.isRequired,
